import React from 'react'

export const Hijo = React.memo(({ numero, increment }) => {

    console.log('  Me volví a generar :(  ');

    return (
        <button
            className="btn btn-primary mr-3"
            onClick={ () => increment( numero ) }
        >
            { numero }
        </button>
    )
});
